package com.syntax.class09;

public class CHECKITLATER {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		for (int i = 0; i < 24; i++) {
		    for (int j = 0; j < 60; j++) {
		        for (int a = 0; a < 60; a++) {
		            System.out.printf("%02d:%02d:%02d\n",i,j,a);

		        }
		    }
		}

	}

}
